window.bookSummaryJSON = "<p>They're the D'Artigo sisters: savvy half-human, half-fae agents of the Otherworld Intelligence Agency. Camille is the queen of dusk and twilight. Delilah is a two-faced werecat and the autumn lord's only living death maiden. And Menolly is a vampire princess and married to a gorgeous werepuma Amazon. </p> <p>It's been four long years since they first found out about Shadow Wing...and now, they're facing the end of the line. It's time for the D'Artigo sisters to extinguish Shadow Wing's evil forever, before he goes mad and tries to unravel the world....</p>"; 
